IF OBJECT_ID('dbo.proc_transform_364', 'P') IS NOT NULL
    DROP PROCEDURE dbo.proc_transform_364;
GO
CREATE PROCEDURE dbo.proc_transform_364
AS
BEGIN
    SET NOCOUNT ON;
    UPDATE dbo.staging_table_364
    SET payload = LEFT(payload, 1000) + N'|V4-364|';
    SELECT TOP (250) LEFT(payload, 200) FROM dbo.staging_table_364;
END
